import React from 'react';
import styles from './Experience.module.css';

const experiences = [
  {
    role: "Software Developer Intern",
    company: "Tech Solutions Inc.",
    period: "May 2023 - Aug 2023",
    details: [
      "Developed and maintained web applications using React and Node.js.",
      "Collaborated with cross-functional teams to deliver features on time.",
      "Improved application performance by 20% through code optimization."
    ]
  },
  {
    role: "Frontend Developer",
    company: "Creative Minds",
    period: "Jan 2022 - Apr 2023",
    details: [
      "Designed responsive UI components with React and CSS Modules.",
      "Worked closely with designers to implement pixel-perfect layouts.",
      "Integrated REST APIs and handled state management with Redux."
    ]
  }
];

const Experience = () => (
  <section id="experience" className={styles.experienceCard}>
    <h1 className={styles.title}>Experience</h1>
    <hr className={styles.hr} />
    <div className={styles.experienceGrid}>
      <div className={styles.timeline}>
        {experiences.map((exp, idx) => (
          <div key={idx} className={styles.expItem}>
            <h2 className={styles.role}>{exp.role}</h2>
            <h3 className={styles.company}>{exp.company}</h3>
            <span className={styles.period}>{exp.period}</span>
            <ul className={styles.details}>
              {exp.details.map((d, i) => (
                <li key={i}>{d}</li>
              ))}
            </ul>
          </div>
        ))}
      </div>
    </div>
  </section>
);

export default Experience;
